oneApp.controller('DevelopmentGridAllAccountsCtrl', ['$scope', 'zemDataSourceService', 'zemDataSourceEndpoints', function ($scope, zemDataSourceService, zemDataSourceEndpoints) {
    var endpoint = zemDataSourceEndpoints.createAllAccountsEndpoint();
    $scope.dataSource = zemDataSourceService.createInstance(endpoint);
    $scope.dataSource.onLoad($scope, function (event, data) {
        var rows = data.rows;
        if (data.level === 0) {
            rows = data.rows[0].breakdown.rows;
        }

        rows.map(function (row) {
            row.stats.name_link = {
                text: row.stats.name,
                state: $scope.getDefaultAccountState(),
                id: row.stats.id,
            };
            return row;
        });
    });
}]);

oneApp.controller('DevelopmentGridCachedCtrl', ['$scope', '$q', '$timeout', 'zemDataSourceService', 'zemDataSourceEndpoints', function ($scope, $q, $timeout, zemDataSourceService, zemDataSourceEndpoints) {
    var legacyApi = createCachedLegacyAPI(cache.allaccounts);
    var endpoint = zemDataSourceEndpoints.createLegacyEndpoint(legacyApi, 'AllAccountsAccountsCtrl');
    $scope.dataSource = zemDataSourceService.createInstance(endpoint);

    function createCachedLegacyAPI (cache) {
        return {
            get: function (page, size, startDate, endDate, order) {
                var deferred = $q.defer();
                $timeout(function () {
                    var data = JSON.parse(cache);
                    data.pagination.currentPage = page;
                    data.pagination.size = size;
                    data.pagination.startIndex = (page - 1) * size + 1;
                    data.pagination.endIndex = page * size;
                    data.rows = data.rows.slice(0, size);
                    deferred.resolve(data);
                }, 1000);
                return deferred.promise;
            },
        };
    }
}]);

